import React,  { Component} from 'react'
import {Link} from 'react-router-dom'
import Axios from 'axios'
import './Picture.css'
import 'font-awesome/css/font-awesome.css'


class Picture extends Component {
    render() {
        return (
            <div className="picpage">
                <h1>Hello!</h1>
                <div className="picbox">
                    <div className= "arrowleft"><i class="fa fa-angle-left"></i></div>
                    <img src="https://img.memecdn.com/tada-tada-da-da-da-ant-man_c_2043617.jpg"/>
                    <div className="arrowright"><i class="fa fa-angle-right"></i></div>
                </div>
            </div>
        )
    }

}

export default Picture
